import React from "react";
import { Link } from "react-router-dom";
import './Navbar.css';

const Navbar = () => {
  return (
    <div>
      <header>
        <img src="" alt="Logo" />
      </header>
      <div className="navbar">
        <li><Link to="/">Home</Link></li>
        <br />
        <li><Link to="/signup">Signup</Link></li>
        <br />
        <li><Link to="/product">Products</Link></li>
      </div>
    </div>
  );
};

export default Navbar;
